## Mapの反復
```js
let myMap = new Map()
myMap.set('0', 'foo')
myMap.set(1, 'bar')
myMap.set({}, 'baz')

//1　1回限定
const iterator1 = myMap[Symbol.iterator]();
console.log(iterator1.next().value)  // ["0", "foo"]
console.log(iterator1.next().value)  // [1, "bar"]
console.log(iterator1.next().value)  // [Object, "baz"]

//2　1回限定
const iterator2 = myMap.entries();
console.log(iterator2.next().value)  // ["0", "foo"]
console.log(iterator2.next().value)  // [1, "bar"]
console.log(iterator2.next().value)  // [Object, "baz"]

//3　限定なし
for (const item of myMap) {
  console.log(item);
}

//4 1回限定
const iterator3 = myMap.entries();//myMap[Symbol.iterator]()
for (const item of iterator3){
    console.log(item);
}
```
